import React from 'react';
import { Link } from 'react-router-dom';
import Navbar from "../components/Navbar";  // Importación por defecto (sin llaves)

const Home = () => {
  return (
      <div className="container">
        <img src="https://tse2.mm.bing.net/th?id=OIP.PDwdB48pMOgzexpIAlrNogHaE8&pid=Api&P=0&h=180" class="img-fluid" alt="..."></img>
      <div className="row">
        <div className="col-md-6 col-lg-4">
          <h2>Columna 1</h2>
          <p>Este es contenido en la primera columna.</p>
        </div>
        <div className="col-md-6 col-lg-4">
          <h2>Columna 2</h2>
          <p>Este es contenido en la segunda columna.</p>
        </div>
        <div className="col-md-6 col-lg-4">
          <h2>Columna 3</h2>
          <p>Este es contenido en la tercera columna.</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
